import React, { useState, useEffect } from "react";

const Event = (props) => {
  const [events, setEvents] = useState([]);

  useEffect(
    () => {
      fetch('/api/events').then(
        res => res.json()
      ).then(
        events => {
          console.log(events);
          setEvents(events);
        }
      )
    },[]
  );
    return (
        <div className="container c-col">
        
        </div>
      );
};
export default Event;
